(1, 1, 'Mr WordPress', '', 'https://wordpress.org/', '', '2015-04-23 09:52:08', '2015-04-23 09:52:08', 'Hi, this is a comment.\nTo delete a comment, just log in and view the post&#039;s comments. There you will have the option to edit or delete them.', 0, 'post-trashed', '', '', 0, 0),
(2, 1135, 'Timmy', 'timmy@theme.co', '', '85.124.77.92', '2013-06-03 21:24:28', '2013-06-04 02:24:28', 'This is the first comment on the post. As you can see, I, Timmy, took my time to type out a very long and well thought out response. While you may think that what I am saying amounts to nothing more than taking up space in a comment block, I can assure you it is much more significant than that. ', 0, 'post-trashed', '', '', 0, 0),
(3, 1135, 'Kimmy', 'kimmy@theme.co', '', '85.124.77.92', '2013-06-03 21:25:19', '2013-06-04 02:25:19', 'This is the first reply.', 0, 'post-trashed', '', '', 2, 0),
(4, 1135, 'Jimmy', 'jimmy@theme.co', '', '85.124.77.92', '2013-06-03 21:25:48', '2013-06-04 02:25:48', 'Jimmy says he likes this article. And Kimmy.', 0, 'post-trashed', '', '', 3, 0);
