(1, 1, '2015-04-23 09:52:08', '2015-04-23 09:52:08', 'Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!', 'Hello world!', '', 'trash', 'open', 'open', '', 'hello-world', '', '', '2015-05-13 08:48:47', '2015-05-13 08:48:47', '', 0, 'http://localhost/monish/?p=1', 0, 'post', '', 1),
(2, 1, '2015-04-23 09:52:08', '2015-04-23 09:52:08', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://localhost/monish/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'trash', 'open', 'open', '', 'sample-page', '', '', '2015-05-13 08:52:09', '2015-05-13 08:52:09', '', 0, 'http://localhost/monish/?page_id=2', 0, 'page', '', 0),
(1135, 1, '2013-05-25 23:12:08', '2013-05-26 04:12:08', 'X is not your grandmother''s WordPress theme, and we want to prove it to you. Here are the top 5 reasons you need to buy X today!\n<h3>Stacks, Stacks, &amp; More Stacks</h3>\nInstead of being stuck with one design for your next project, X is a gift that keeps on giving. Built with our custom Stacks, X is the most versatile premium WordPress theme on the market today. Think of Stacks like full site designs built into the theme with each one giving a totally unique look and feel. There are currently three Stacks to chose from: Integrity, Renew, and Icon.\n<h3>Point &amp; Click</h3>\nX is not only one of the most cutting edge themes on the market today, it''s incredibly easy to customize using the latest innovation from WordPress: the Theme Customizer. Instead of clicking through pages and pages of an admin panel only to have to click back and forth between the dashboard and your live site, with X you can change every aspect of your site while viewing it through the Customizer. See in real time how every color, layout, and pixel will look then click "Save" and you''re done. Customizing a theme has never been so easy.\n<h3>Built By Experts</h3>\nWe weren''t satisfied with just making "another" WordPress theme...so we decided to do something different. We reached out to many of the top business and internet marketing minds of today to ask them about things like conversion, copywriting, layouts, squeeze pages, SEO, and more. X is the culmination of over a dozen of the smartest marketers on the planet who shared their expertise to build into this truly ultimate theme. You can learn more about the experts who contributed in our <a href="/x/demo/integrity/1/features/" title="X WordPress Theme Features">features</a> section.\n<h3>Future Proof</h3>\nHTML5. CSS3. Fully Responsive, and more! X is not only built to be the most beautiful and powerful WordPress Theme of 2013, it is ready for the future. With a sharp development team that stays on the cutting edge of all that WordPress has to offer, you can rest assured that any site using X will be steps ahead of the pack employing the high-end functionality your site demands.\n<h3>Simply The Best</h3>\nDon''t just take our word for it. See for yourself. First time users frequently report how fun and easy it is to customize X exactly to their likings. Whether that''s boxed or full width, dark or light, multi colors or minimal, large fonts or small -- X is like nothing you have ever seen!', '5 Reasons You Need The X Theme', '', 'trash', 'open', 'open', '', '5-reasons-you-need-the-x-theme', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1135', 0, 'post', '', 3),
(1143, 1, '2013-05-25 02:43:31', '2013-05-25 02:43:31', 'Sometimes there''s nothing more powerful than the perfect song and image to go with it. Here is an audio post with the optional featured image.', 'Audio With Image', '', 'trash', 'open', 'open', '', 'audio-with-image', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1143', 0, 'post', '', 0),
(1151, 1, '2013-05-25 03:19:06', '2013-05-25 08:19:06', 'You can share your favorite audio files for all your visitors to listen to. You have the choice to set a featured image, however this is how things look when you have an audio post without one.', 'Audio Without Image', '', 'trash', 'open', 'open', '', 'audio-without-image', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1151', 0, 'post', '', 0),
(1156, 1, '2013-05-25 04:15:17', '2013-05-25 09:15:17', 'Looking to embed videos from YouTube, Vimeo, or any of the other popular video sites? No problem at all. Simply take the embed video code, add it to the video settings, and you''re done.', 'Little Red Riding Hood (Embedded Video)', '', 'trash', 'open', 'open', '', 'little-red-riding-hood', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1156', 0, 'post', '', 0),
(1159, 1, '2013-05-25 03:18:54', '2013-05-25 03:18:54', 'Link posts are great for sharing cool sites and online resources. All links open in a new window, and the title of your post shows above the link. As always the featured image is optional. Should you decide to use a featured image, you can upload any size (height and width), and X will take care of the rest.', 'Have You Heard Of Them?', '', 'trash', 'open', 'open', '', 'have-you-heard-of-them', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1159', 0, 'post', '', 0),
(1162, 1, '2013-05-25 08:20:58', '2013-05-25 08:20:58', 'This is quote post where you can share all your favorite sayings. The featured image is optional.', 'Thought For The Day', '', 'trash', 'open', 'open', '', 'thought-for-the-day', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1162', 0, 'post', '', 0),
