(1199, 1, '2013-05-25 04:40:28', '2013-05-25 04:40:28', 'In this gallery post format, you can include a grouping of images to share with your visitors or customers. In addition you can type any text you want to show up below or leave this area blank to just show the images. You can even use the arrows to browse through the images without having to click through to the post.', 'Beautiful Gallery Post', '', 'trash', 'open', 'open', '', 'beautiful-gallery-post', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1199', 0, 'post', '', 0),
(1207, 1, '2013-05-25 04:54:35', '2013-05-25 09:54:35', 'This is a great way to showcase cool individual images in a quick and easy way. While writing your post: select the image format, add your featured image, then click Publish!', 'Image Post', '', 'trash', 'open', 'open', '', 'image-post', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1207', 0, 'post', '', 0),
(1219, 1, '2013-05-25 09:11:51', '2013-05-25 09:11:51', '[pullquote]If you like the format of the video above, we have put together dozens of others for everyone who purchases X. Learn about all sorts of different topics like Affiliate Marketing, Email Marketing, SEO, Digital Products, and more.[/pullquote]\n\nFor those looking for a more customized solution, you can upload your own self-hosted videos using the nifty Video Post Format right from within your dashboard. Each video will be fully responsive and look great on any device!\n\nSimply create a post like you always would, select Video in the format box, then enter the destination of your video file (MP4, M4V, OGV) right below the main content area. In addition you can select the desired aspect ratio for optimum viewing.\n\nLike above, you can optionally set a featured image that will show before the video is played.', 'Affiliate Marketing 101 (Self Hosted Video)', '', 'trash', 'open', 'open', '', 'affiliate-marketing-101-self-hosted-video', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 0, 'http://theme.co/x/demo/integrity/10/?p=1219', 0, 'post', '', 0),
