(5616, 1, '2013-05-25 04:55:58', '2013-05-25 09:55:58', 'With several dozen of the best looking Shortcodes around, we wanted to give you a sample of the many high-end Shortcodes built into X. We''ve grouped some together so this isn''t a super long post, however for a complete list with demos and examples of each, be sure to head over to our <a title="Shortcodes" href="/x/demo/integrity/1/shortcodes/">Shortcodes</a> page.\r\n\r\n[custom_headline type="left" style="margin-top: 45px;" level="h2" looks_like="h5" accent="true"]Image Frame, Tooltips, Popovers &amp; 3D Button [/custom_headline]\r\n\r\n[image src="/media/x-popover-tooltip-example.jpg" float="left" type="thumbnail" link="true" href="#example" alt="Example" title="Check Me Out!" info="tooltip" info_place="top" info_trigger="hover"] Vivamus sagittis lacus vel augue laoreet rutrum faucibus dolor auctor. Vivamus sagittis lacus vel augue laoreet rutrum faucibus dolor auctor. [extra href="#example" target="_blank" info="tooltip" info_place="top" info_trigger="hover" title="Yeah, tooltip time!"]Donec sed[/extra] odio dui. Maecenas faucibus mollis interdum. [extra href="#example" target="_blank" info="tooltip" info_place="right" info_trigger="hover" title="Yeah, tooltip time!"]Cras justo odio[/extra], dapibus ac facilisis in, egestas eget quam. Etiam porta sem malesuada magna mollis euismod. Integer posuere erat a ante venenatis dapibus posuere velit aliquet. [extra href="#example" target="_blank" info="tooltip" info_place="left" info_trigger="hover" title="Yeah, tooltip time!"]Curabitur blandit[/extra] tempus porttitor. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum. Cras mattis consectetur purus sit amet fermentum. [extra href="#example" target="_blank" info="tooltip" info_place="bottom" info_trigger="hover" title="Yeah, tooltip time!"]Cum sociis[/extra] natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.\r\n\r\n[button style="margin-bottom: 1.313em;" href="#example" title="I told you so!" circle="true" info="tooltip" info_place="top" info_trigger="hover" block="true"]You Can Even Add Popovers and Tooltips to Me![/button]\r\n\r\n[image src="/media/x-popover-tooltip-example.jpg" float="right" type="thumbnail" link="true" href="#example" alt="Example" title="Check Me Out!" info="popover" info_place="top" info_trigger="hover" info_content="Enter in some more information here."] Vivamus sagittis lacus vel augue laoreet rutrum faucibus dolor auctor. Vivamus sagittis lacus vel augue laoreet rutrum faucib Lacus vel augue laoreet rutrum faucibus dolor auctor. Vivamus sagittis lacus [extra href="#example" target="_blank" info="popover" info_place="top" info_trigger="hover" info_content="Place a little extra content in here for informational purposes." title="Yeah, popover time!"]vel augue[/extra] laoreet rutrum faucibus dolor auctor. Donec sed odio dui. Maecenas faucibus mollis interdum. Cras justo odio, dapibus ac facilisis in, [extra href="#example" target="_blank" info="popover" info_place="right" info_trigger="hover" info_content="Place a little extra content in here for informational purposes." title="Yeah, popover time!"]egestas eget quam[/extra]. Etiam porta sem malesuada magna mollis euismod. Integer posuere erat a ante venenatis dapibus posuere velit aliquet. [extra href="#example" target="_blank" info="popover" info_place="left" info_trigger="hover" info_content="Place a little extra content in here for informational purposes." title="Yeah, popover time!"]Curabitur blandit[/extra] tempus porttitor. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum. Cras mattis consectetur purus sit amet fermentum. [extra href="#example" target="_blank" info="popover" info_place="bottom" info_trigger="hover" info_content="Place a little extra content in here for informational purposes." title="Yeah, popover time!"]Cum sociis[/extra] natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Integer posuere erat a ante venenatis dapibus posuere.\r\n\r\n[custom_headline type="left" style="margin-top: 45px;" level="h2" looks_like="h5" accent="true"]Table of Contents &amp; Icon List[/custom_headline]\r\n\r\n[toc type="left"] [toc_item title="1. Introduction" page="1"] [toc_item title="2. More Information" page="2"] [toc_item title="3. Even More Information" page="3"] [/toc]\r\n\r\nThe Table of Contents shortcode available in X offers up some incredible SEO benefits to your standard posts and pages. It''s easy enough to paginate individual posts or pages in WordPress using the <code>&lt;!--nextpage--&gt;</code> code in the editor, but it doesn''t provide any real engaging way for your visitors to know what they''re in for as they click through to the next post. That''s where the Table of Contents shortcode comes in.\r\n\r\nSimply add this to each of your "pages" after your <code>&lt;!--nextpage--&gt;</code> breaks and input the titles of each section in your article. What you''re left with is a thoroughly engaging, easy to navigate post structure that has been proven to increase visitor retention and keep their attention (all things Google loves).\r\n\r\nYou can easily add the Table of Contents shortcode to the left or right of your post content, or have it go full width, which is great for placing at the bottom of your posts to remind visitors of what sections are left. Click through on the table of contents shortcode above to go through to the next page and see the shortcode in action!\r\n\r\n[icon_list]\r\n[icon_list_item type="chevron-sign-right"]This[/icon_list_item]\r\n[icon_list_item type="chevron-sign-right"]is[/icon_list_item]\r\n[icon_list_item type="chevron-sign-right"]a[/icon_list_item]\r\n[icon_list_item type="chevron-sign-right"]icon[/icon_list_item]\r\n[icon_list_item type="chevron-sign-right"]list[/icon_list_item]\r\n[icon_list_item type="chevron-sign-right"]<strong>Chose from