(6608, 1, '2014-02-05 18:37:26', '2014-02-05 18:37:26', 'We wanted to take a moment to thank you for purchasing X and checking out the demo content! Taking a look through this demo content you''ll be able to see how we setup various post formats for the blog such as the gallery, video, and audio post format, and there are also plenty of portfolio post examples as well. Take some time to review their content and meta settings below the editor to get an idea for how to set them up.\n\nTo setup your homepage and blog page properly, be sure to go to <strong>Settings > Reading</strong> and choose <strong>A static page</strong> for the <strong>Front page displays</strong> option. Once you have done so, you can assign the appropriate pages to the front page and posts page of your site. Additionally, make sure to consult the documentation as well as our video tutorials in the member area to see how to setup the portfolio section of your website. Once you have joined the member area, you''ll also have access to our homepage examples, Customizer import settings, video training resources, child themes, photoshop files, and so much more!', 'Page', '', 'trash', 'open', 'open', '', 'page', '', '', '2015-05-13 08:52:09', '2015-05-13 08:52:09', '', 0, 'http://theme.co/x/demo/content/?page_id=6608', 0, 'page', '', 0),
