(6641, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'X is not your grandmother''s WordPress theme, and we want to prove it to you. Here are the top 5 reasons you need to buy X today!\n<h3>Stacks, Stacks, &amp; More Stacks</h3>\nInstead of being stuck with one design for your next project, X is a gift that keeps on giving. Built with our custom Stacks, X is the most versatile premium WordPress theme on the market today. Think of Stacks like full site designs built into the theme with each one giving a totally unique look and feel. There are currently three Stacks to chose from: Integrity, Renew, and Icon.\n<h3>Point &amp; Click</h3>\nX is not only one of the most cutting edge themes on the market today, it''s incredibly easy to customize using the latest innovation from WordPress: the Theme Customizer. Instead of clicking through pages and pages of an admin panel only to have to click back and forth between the dashboard and your live site, with X you can change every aspect of your site while viewing it through the Customizer. See in real time how every color, layout, and pixel will look then click "Save" and you''re done. Customizing a theme has never been so easy.\n<h3>Built By Experts</h3>\nWe weren''t satisfied with just making "another" WordPress theme...so we decided to do something different. We reached out to many of the top business and internet marketing minds of today to ask them about things like conversion, copywriting, layouts, squeeze pages, SEO, and more. X is the culmination of over a dozen of the smartest marketers on the planet who shared their expertise to build into this truly ultimate theme. You can learn more about the experts who contributed in our <a href="/x/demo/integrity/1/features/" title="X WordPress Theme Features">features</a> section.\n<h3>Future Proof</h3>\nHTML5. CSS3. Fully Responsive, and more! X is not only built to be the most beautiful and powerful WordPress Theme of 2013, it is ready for the future. With a sharp development team that stays on the cutting edge of all that WordPress has to offer, you can rest assured that any site using X will be steps ahead of the pack employing the high-end functionality your site demands.\n<h3>Simply The Best</h3>\nDon''t just take our word for it. See for yourself. First time users frequently report how fun and easy it is to customize X exactly to their likings. Whether that''s boxed or full width, dark or light, multi colors or minimal, large fonts or small -- X is like nothing you have ever seen!', '5 Reasons You Need The X Theme', '', 'inherit', 'open', 'open', '', '1135-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1135, 'http://localhost/monish/2015/05/1135-revision-v1/', 0, 'revision', '', 0),
(6642, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', '[pullquote]If you like the format of the video above, we have put together dozens of others for everyone who purchases X. Learn about all sorts of different topics like Affiliate Marketing, Email Marketing, SEO, Digital Products, and more.[/pullquote]\n\nFor those looking for a more customized solution, you can upload your own self-hosted videos using the nifty Video Post Format right from within your dashboard. Each video will be fully responsive and look great on any device!\n\nSimply create a post like you always would, select Video in the format box, then enter the destination of your video file (MP4, M4V, OGV) right below the main content area. In addition you can select the desired aspect ratio for optimum viewing.\n\nLike above, you can optionally set a featured image that will show before the video is played.', 'Affiliate Marketing 101 (Self Hosted Video)', '', 'inherit', 'open', 'open', '', '1219-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1219, 'http://localhost/monish/2015/05/1219-revision-v1/', 0, 'revision', '', 0),
(6643, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'This is quote post where you can share all your favorite sayings. The featured image is optional.', 'Thought For The Day', '', 'inherit', 'open', 'open', '', '1162-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1162, 'http://localhost/monish/2015/05/1162-revision-v1/', 0, 'revision', '', 0),
(6644, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'This is a great way to showcase cool individual images in a quick and easy way. While writing your post: select the image format, add your featured image, then click Publish!', 'Image Post', '', 'inherit', 'open', 'open', '', '1207-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1207, 'http://localhost/monish/2015/05/1207-revision-v1/', 0, 'revision', '', 0),
(6645, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'In this gallery post format, you can include a grouping of images to share with your visitors or customers. In addition you can type any text you want to show up below or leave this area blank to just show the images. You can even use the arrows to browse through the images without having to click through to the post.', 'Beautiful Gallery Post', '', 'inherit', 'open', 'open', '', '1199-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1199, 'http://localhost/monish/2015/05/1199-revision-v1/', 0, 'revision', '', 0),
(6646, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'Looking to embed videos from YouTube, Vimeo, or any of the other popular video sites? No problem at all. Simply take the embed video code, add it to the video settings, and you''re done.', 'Little Red Riding Hood (Embedded Video)', '', 'inherit', 'open', 'open', '', '1156-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1156, 'http://localhost/monish/2015/05/1156-revision-v1/', 0, 'revision', '', 0),
(6647, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'You can share your favorite audio files for all your visitors to listen to. You have the choice to set a featured image, however this is how things look when you have an audio post without one.', 'Audio Without Image', '', 'inherit', 'open', 'open', '', '1151-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1151, 'http://localhost/monish/2015/05/1151-revision-v1/', 0, 'revision', '', 0),
(6648, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'Link posts are great for sharing cool sites and online resources. All links open in a new window, and the title of your post shows above the link. As always the featured image is optional. Should you decide to use a featured image, you can upload any size (height and width), and X will take care of the rest.', 'Have You Heard Of Them?', '', 'inherit', 'open', 'open', '', '1159-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1159, 'http://localhost/monish/2015/05/1159-revision-v1/', 0, 'revision', '', 0),
(6649, 1, '2015-05-13 08:48:48', '2015-05-13 08:48:48', 'Sometimes there''s nothing more powerful than the perfect song and image to go with it. Here is an audio post with the optional featured image.', 'Audio With Image', '', 'inherit', 'open', 'open', '', '1143-revision-v1', '', '', '2015-05-13 08:48:48', '2015-05-13 08:48:48', '', 1143, 'http://localhost/monish/2015/05/1143-revision-v1/', 0, 'revision', '', 0),
