(6669, 1, '2015-05-13 08:52:09', '2015-05-13 08:52:09', 'We wanted to take a moment to thank you for purchasing X and checking out the demo content! Taking a look through this demo content you''ll be able to see how we setup various post formats for the blog such as the gallery, video, and audio post format, and there are also plenty of portfolio post examples as well. Take some time to review their content and meta settings below the editor to get an idea for how to set them up.\n\nTo setup your homepage and blog page properly, be sure to go to <strong>Settings > Reading</strong> and choose <strong>A static page</strong> for the <strong>Front page displays</strong> option. Once you have done so, you can assign the appropriate pages to the front page and posts page of your site. Additionally, make sure to consult the documentation as well as our video tutorials in the member area to see how to setup the portfolio section of your website. Once you have joined the member area, you''ll also have access to our homepage examples, Customizer import settings, video training resources, child themes, photoshop files, and so much more!', 'Page', '', 'inherit', 'open', 'open', '', '6608-revision-v1', '', '', '2015-05-13 08:52:09', '2015-05-13 08:52:09', '', 6608, 'http://localhost/monish/2015/05/6608-revision-v1/', 0, 'revision', '', 0),
(6670, 1, '2015-05-13 08:52:09', '2015-05-13 08:52:09', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://localhost/monish/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2015-05-13 08:52:09', '2015-05-13 08:52:09', '', 2, 'http://localhost/monish/2015/05/2-revision-v1/', 0, 'revision', '', 0),
