c_row no_margin="true" inner_container="true" bg_color="#fff" border="none"][vc_column width="1/2"][icon_list][icon_list_item type="check" class="mbm"]Four completely unique designs built into one powerful WordPress theme.[/icon_list_item][icon_list_item type="check" class="mbm"]You''ll receive expert advise from industry leaders to help you succeed.[/icon_list_item][icon_list_item type="check" class="mbm"]Live edit your site with our souped up version of the WordPress Customizer.[/icon_list_item][/icon_list][visibility type="visible-phone"][gap size="3em"][/visibility][/vc_column][vc_column width="1/2"][skill_bar heading="Nunchuck Skills" percent="56%"][skill_bar heading="Bow Hunting Skills" percent="49%"][skill_bar heading="Computer Hacking Skills" percent="62%"][skill_bar heading="WordPress Skills" percent="100%" class="mbn"][/vc_column][/vc_row]', 'Demo: Home', '', 'publish', 'closed', 'closed', '', 'demo-home', '', '', '2015-05-14 04:16:02', '2015-05-14 04:16:02', '', 0, 'http://localhost/monish/demo-home/', 0, 'page', '', 0),
