(6684, 1, '2015-05-05 08:58:16', '2015-05-05 08:58:16', '<p>Looking to embed videos from YouTube, Vimeo, or any of the other popular video sites? No problem at all. Simply take the embed video code, add it to the video settings, and you''re done.</p>', 'Demo: Little Red Riding Hood (Embedded Video)', '', 'publish', 'open', 'open', '', 'demo-little-red-riding-hood-embedded-video', '', '', '2015-05-05 08:58:16', '2015-05-05 08:58:16', '', 0, 'http://localhost/monish/2015/05/demo-little-red-riding-hood-embedded-video/', 0, 'post', '', 0),
(6685, 1, '2015-05-04 08:58:16', '2015-05-04 08:58:16', '<p>You can share your favorite audio files for all your visitors to listen to. You have the choice to set a featured image, however this is how things look when you have an audio post without one.</p>', 'Demo: Audio Without Image', '', 'publish', 'open', 'open', '', 'demo-audio-without-image', '', '', '2015-05-04 08:58:16', '2015-05-04 08:58:16', '', 0, 'http://localhost/monish/2015/05/demo-audio-without-image/', 0, 'post', '', 0),
(6686, 1, '2015-05-03 08:58:16', '2015-05-03 08:58:16', '<p>Link posts are great for sharing cool sites and online resources. All links open in a new window, and the title of your post shows above the link. As always the featured image is optional. Should you decide to use a featured image, you can upload any size (height and width), and X will take care of the rest.</p>', 'Demo: Have You Heard Of Them?', '', 'publish', 'open', 'open', '', 'demo-have-you-heard-of-them', '', '', '2015-05-03 08:58:16', '2015-05-03 08:58:16', '', 0, 'http://localhost/monish/2015/05/demo-have-you-heard-of-them/', 0, 'post', '', 0),
(6687, 1, '2015-05-02 08:58:16', '2015-05-02 08:58:16', '<p>Sometimes there''s nothing more powerful than the perfect song and image to go with it. Here is an audio post with the optional featured image.</p>', 'Demo: Audio With Image', '', 'publish', 'open', 'open', '', 'demo-audio-with-image', '', '', '2015-05-02 08:58:16', '2015-05-02 08:58:16', '', 0, 'http://localhost/monish/2015/05/demo-audio-with-image/', 0, 'post', '', 0),
